@import '@/assets/styles/sprite-home.scss';
@import '@/assets/styles/sprite-mine.scss';

.mine {
  position: relative;
  flex-direction: column;
  width: 100%;
  height: 100%;
}

.nav-bar {
  padding-bottom: 45px;
}

.action-btn {
  &:nth-child(1):after {
    content: '';
    height: 40px;
    top: 5px;
    position: absolute;
    right: 0;
    border-right: 1px solid #d6dce8 !important;
  }
}

.no-data {
  width: 300px;
  margin: 0 auto;
  margin-top: 120px;

  img {
    width: 180px;
    height: 130px;
    margin: 0 auto 20px;
    // height: 110px;
  }

  .text-no-data {
    width: 100%;
    margin-bottom: 22px;
    color: #999;
    font-size: 28px;
    text-align: center;
  }
}

:deep(.van-tabs__nav) {
  background: transparent !important;

  &.active {
    color: var(--van-button-primary-background);
    font-weight: bold;
  }
}

:deep(.van-tab) {
  color: #868d9a;
  font-weight: normal;
}

:deep(.van-tab--active) {
